import React from 'react'
import data from '../../data/data'

function Fixture() {

    console.log(data.groupA.matches.firstPhase)

  return (
    <div>
        {
           data.groupA.matches.firstPhase.map( match => 
           <div id={match.id}>
                <img src={data.countries[(match.local-1)].flag} alt="" />
                <p>
                    {data.countries[(match.local-1)].name} vs. {data.countries[(match.visitor)-1].name}
                </p>
                <img src={data.countries[(match.local-1)].flag} alt="" />
           </div>)
        }

    </div>
  )
}

export default Fixture
